import React, {Component} from 'react';
import Header from '../components/Header.js'
import PopularCity from '../components/PopularCity.js'

class Home extends Component {
    constructor(props){
        super(props);
        this.state = {
            cityList: ["NewYork","Berlin","Saigon","Munich","Tokyo",],
        }
    }
    display = () =>{
        let cities =[];
        this.state.cityList.map(city=>cities.push(<PopularCity key={city} cityName={city}></PopularCity>))
      return cities.slice(0,4);
    };
    render() {
        return (
            <div>
                <Header></Header>
                <div className="contain">
                    <p className="section">Find your perfect trip, designed by insiders who know and love their
                        cities.</p>
                    <div className="section">
                        <img className="circle" src={require("../images/circled-right.png")} alt="circle"/>
                    </div>
                    <div className="section popularCities">
                        <h5>Popular MYtinerary</h5>
                        <div className="cityDisplay">
                            {this.display()}
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
